The AR-15 (the bipod in the pictures isn't attached; I just used to to prop-up the rifle for the pictures, but it's part of the deal if you want it)

- Lower/Upper Assembly (manufactured in 2012): Factory stock DPMS Oracle; .223/5.56 Flat Top, 16" barrel, 1/9 Twist;
- Lower/Upper Furniture: Bushmaster A2 Trapdoor Buttstock Assembly; Magpul L2 MOE forend, foregrip and 1913 Picatinny rail;
- Duracoat Finish: Tactical Tiger Stripe (Dark Earth and Coyote Brown);
- Optics: NcSTAR 3-9X42 MIL DOT Quick-Release Scope.
